        private ApplicationUser _user4;
        private ApplicationUser _admin;

        public async void SeedDataAsync(MT4NorthContext context, UserManager<ApplicationUser> userManager, RoleManager<IdentityRole> roleManager)
        {
            _user1 = await userManager.FindByEmailAsync("user1@localhost");
            _user2 = await userManager.FindByEmailAsync("user2@localhost");
            _user3 = await userManager.FindByEmailAsync("user3@localhost");
            _user4 = await userManager.FindByEmailAsync("user4@localhost");
            _admin = await userManager.FindByEmailAsync("admin@localhost");

            SeedRoles(roleManager);
            SeedUsersAsync(userManager);
            await SeedProjectsAsync(context);

        }

        private async void CreateProject(
            MT4NorthContext context, string projectName, string projectDescription, ApplicationUser[] users, string[] userRoles, string[] userRights)
        {
            if (context.Projects.Any(e => e.Name == projectName) != true)
            {
                // Create Themes
                var themeNames = new string[] { "Teknikutveckling", "Kliniskutveckling", "Validering" };
                var _themes = new List<Theme>();
                foreach (var themeName in themeNames)
                {
                    var theme = new Theme
                    {
                        Name = themeName,
                        Description = "Beskrivning av temat " + themeName + " till projektet " + projectName,
                    };
                    context.Themes.Add(theme);
                    _themes.Add(theme);
                }
                context.SaveChanges();

                // Create Activitys
                // Base
                var i = 0;
                var j = 0;
                var baseActivityNames = new string[] { "Observera grundläggande principer", "Utveckla prototyp baserat på koncept", "Hitta patient underlag", "Etiskprövning", "Metod validering", "ISO studio" };
                var customActivityNames = new string[] { "CustomAktivityInfo-1", "CustomAktivityInfo-2", "CustomAktivityInfo-3", "CustomAktivityInfo-4", "CustomAktivityInfo-5", "CustomAktivityInfo-6", "CustomAktivityInfo-7", "CustomAktivityInfo-8", "CustomAktivityInfo-9", "CustomAktivityInfo-10", "CustomAktivityInfo-11", "CustomAktivityInfo-12" };
                var phases = new string[] { "Klar", "Klar", "Pågående", "Pågående", "Ej påbörjad", "Ej påbörjad" };
                var _baseActivitys = new List<BaseActivityInfo>();
                foreach (var baseActivityName in baseActivityNames)
                {
                    var baseActivity = new BaseActivityInfo
                    {
                        Name = baseActivityName,
                        Description = "Beskrivning av bas aktivitet " + baseActivityName,
                        Phase = phases[j],
                        Theme = _themes[i],
                    };
                    context.BaseActivityInfos.Add(baseActivity);
                    _baseActivitys.Add(baseActivity);
                    j++;
                    if (j % 2 == 0)
                    {
                        i++;
                    }
                }
                context.SaveChanges();
                // Custom
                var h = 0;
                var k = 0;
                var l = 0;
                var _customActivitys = new List<CustomActivityInfo>();
                foreach (var customActivityName in customActivityNames)
                {
                    var customActivity = new CustomActivityInfo
                    {
                        Name = customActivityName,
                        Description = "Beskrivning av anpassad aktivitet " + customActivityName,
                        Phase = phases[h],
                        Theme = _themes[k],
                    };
                    context.CustomActivityInfos.Add(customActivity);
                    //context.SaveChanges();
                    _customActivitys.Add(customActivity);
                    l++;
                    if (l % 2 == 0)
                    {
                        h++;
                    }
                    if (l % 4 == 0)
                    {
                        k++;
                    }
                }
                context.SaveChanges();

                // Project
                var project = new Project
                {
                    Name = projectName,
                    Description = projectDescription,
                };
                context.Projects.Add(project);
                context.SaveChanges();
                // UserProject user <-> project
                var m = 0;
                foreach (var user in users)
                {
                    var userProject = new UserProject
                    {
                        Rights = userRights[m],
                        Role = userRoles[m],
                        User = user,
                        Project = project,
                        Status = UserProjectStatus.Accepted
                    };
                    context.UserProjects.Add(userProject);
                    m++;
                }
                context.SaveChanges();

                var n = 0;
                var o = 0;
                var status = new string[] { "Klar", "Klar", "Pågående", "Pågående", "Ej Påbörjad", "Ej påbörjad" };
                foreach (var baseActivity in _baseActivitys)
                {
                    var activity = new Activity
                    {
                        IsExcluded = false,
                        Status = status[o],
                        //BaseInfo = baseActivity,
                        /*CustomActivityInfos = new List<CustomActivityInfo>(new CustomActivityInfo[]
                        {
                            _customActivitys[n],
                            _customActivitys[n+1]
                        }),*/
                        StartDate = DateTime.Now,
                        FinishDate = DateTime.Now.AddDays(10),
                        DeadlineDate = DateTime.Now.AddDays(14),
                        Resources = "",
                        Project = project
                    };
                    context.Activities.Add(activity);
                    n = n+2;
                    o++;
                }
                context.SaveChanges();
            }
        }

        private async Task SeedProjectsAsync(MT4NorthContext context)
        {
            CreateProject(context, "Projekt Ett1", "En beskrivning a projekt ett", new ApplicationUser[] { _user1, _user2, _user3 }, new string[] { "ProjektÄgare", "Deltagare", "Beställare" }, new string[] { "RW", "RW", "R" });
            CreateProject(context, "Projekt Två", "En beskrivning a projekt två", new ApplicationUser[] { _user3, _user2, _user4 }, new string[] { "ProjektÄgare", "Granskare", "Granskare"  }, new string[] { "RW", "R" , "R" });
        }

